import React from 'react';

function hitLights () {
	// $(document.body).css("background-color", "darkcyan")
	document.body.style.backgroundColor = "darkcyan";
}

const DarkMode = (hitLights) => {
	return (
		<div onclick={hitLights}>DARK MODE</div>
	)
};

export default DarkMode;
